import React, { useState } from "react";
import axios from "axios";

const VF3_DieselFillingForm = () => {
  const [formData, setFormData] = useState({
    DL_VIN: "",
    DL_VC: "",
    DL_ACT_QTY: "",
    DL_RESULT: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("/api/vf3-diesel-filling", formData);
      alert("VF3 Diesel Filling data submitted successfully!");
    } catch (error) {
      alert("Submission failed!");
      console.error(error);
    }
  };

  return (
    <form
      onSubmit={handleSubmit}
      className="p-4 bg-white rounded shadow-md space-y-3 w-full max-w-2xl mx-auto"
    >
      <h2 className="text-xl font-bold mb-4">VF3 - Diesel Filling Form</h2>
      <input
        type="text"
        name="DL_VIN"
        placeholder="DL_VIN"
        value={formData.DL_VIN}
        onChange={handleChange}
        className="w-full p-2 border border-gray-300 rounded"
      />
      <input
        type="text"
        name="DL_VC"
        placeholder="DL_VC"
        value={formData.DL_VC}
        onChange={handleChange}
        className="w-full p-2 border border-gray-300 rounded"
      />
      <input
        type="number"
        name="DL_ACT_QTY"
        placeholder="DL_ACT_QTY"
        value={formData.DL_ACT_QTY}
        onChange={handleChange}
        className="w-full p-2 border border-gray-300 rounded"
      />
      <input
        type="text"
        name="DL_RESULT"
        placeholder="DL_RESULT"
        value={formData.DL_RESULT}
        onChange={handleChange}
        className="w-full p-2 border border-gray-300 rounded"
      />
      <button
        type="submit"
        className="bg-black text-white px-4 py-2 rounded hover:bg-gray-800"
      >
        Submit
      </button>
    </form>
  );
};

export default VF3_DieselFillingForm;
